import React from 'react';
import {Route,Redirect } from "react-router-dom";
import {isLoggedIn} from './Authentication';

export const PrivateRoute = ({ component: Component, ...rest }) => (
  <Route
    {...rest}
    render={props =>
        isLoggedIn() ? (
        <Component {...props} />
      ) : (
        <Redirect
          to={{
            pathname: "/logIn",
            state: { from: props.location }
          }}
        />
      )
    }
  />
);
